import React from 'react';
import logo from '../Images/logo.PNG';

const List=()=>{
    return(
        <>
        <header>
            <div className="container container-flex">
                <div className="logoContainer">
                    <img src={logo} alt="logo" className="logo"/>
                </div>
                <nav>
                    <div className="list">
                        <a href="#">Home</a>
                    </div>
                </nav>
            </div>

        </header>

        </>
    )
}
export default List;
